import React from 'react';

function Quote(){
    return (
        <div>
            <img src="https://image.freepik.com/free-vector/browen-torn-paper-transparent-background_1017-23481.jpg" width="100%" height="200px" alt="mo"/>
            <h1 className="quote-inspire">“Until one has loved an animal, a part of one’s soul remains unawakened.”</h1>
            <h5 className="quote-inspire">-Anatole Frances</h5>
            <img className="bottom-torn-paper" src="https://image.freepik.com/free-vector/browen-torn-paper-transparent-background_1017-23481.jpg" width="100%" height="200px" alt="hoho"/>

        </div>
    )
}

export default Quote;
